import React, { useEffect, useState } from "react";
import { response as localData } from '.';

function ProductList() {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const res = await fetch("https://your-api-url.com/products");
        if (!res.ok) throw new Error("Network response not ok");

        const data = await res.json();
        setProducts(data.products);
      } catch (error) {
        console.warn("Fetch failed, using local data instead.");
        setProducts(localData.products);
      }
    };

    fetchData();
  }, []);

  return (
    <div className="grid grid-cols-2 md:grid-cols-4 gap-4">
      {products.map((product) => (
        <div key={product.id} className="border p-2 rounded shadow">
          <img src={product.img} alt={product.desc} />
          <h3 className="font-semibold">{product.brand}</h3>
          <p>{product.desc}</p>
          <p>Price: â‚¹{product.face}</p>
        </div>
      ))}
    </div>
  );
}

export default ProductList;
